import { motion } from "framer-motion";
const MotionWrap = (Component,classNames) =>function HOC() {
    return (
      <motion.div
        whileInView={{y:[150,50,0], opacity: [0,0, 1] }}
        className={`${classNames} flex`}
        >
            <Component/>
      </motion.div>
    );
}
export default MotionWrap;
